import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import {CodeOutlined, CreateOutlined, SearchOutlined, SendOutlined} from '@material-ui/icons'
import {NavLink} from 'react-router-dom';
import {Button} from "@material-ui/core";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    drawerPaper: {
        paddingRight: theme.spacing(3),
        paddingLeft: 'calc(100vh/3)',
    },
    drawerContainer: {
        overflow: 'auto',
    },
    drawer: {
        flexShrink: 0,
    },

}));

const MainDrawer = () => {
    const classes = useStyles();

    return (
        <div>
        <Drawer
            className={classes.drawer}
            variant="permanent"
            classes={{
                paper: classes.drawerPaper,
            }}
        >
            <Toolbar/>
            <div className={classes.drawerContainer}>
                <List>
                    <ListItem key="Coding">
                        <NavLink to='/coding' component={Button}>
                            <ListItemIcon><CodeOutlined/></ListItemIcon>
                            <ListItemText primary="Coding"/>
                        </NavLink>
                    </ListItem>
                    <ListItem key="Writing">
                        <NavLink to='/writing' component={Button}>
                            <ListItemIcon><CreateOutlined/></ListItemIcon>
                            <ListItemText primary="Writing"/>
                        </NavLink>
                    </ListItem>
                    <ListItem key="Learning">
                        <NavLink to='/learning' component={Button}>
                            <ListItemIcon><SearchOutlined/></ListItemIcon>
                            <ListItemText primary="Learning"/>
                        </NavLink>
                    </ListItem>
                </List>
                <Divider/>
                <List>
                    <ListItem button key="Contact">
                        <ListItemIcon><SendOutlined/></ListItemIcon>
                        <ListItemText primary="Contact"/>
                    </ListItem>
                </List>
            </div>
        </Drawer>

        </div>
    )
}

export default MainDrawer;
